import {Link} from "react-router-dom";

const initialFoods = ['burrito', 'salad', 'sushi', 'pasta'];
function FoodNav({food = initialFoods, color= 'green'}){
    return(
        <ul>
            {food.map(food=>(
                <li key={food}>
                    <Link to={`/food/${food}/${color}`}> Show me {food}</Link>
                </li>
            ))}
        </ul>
    )
}

export default FoodNav;
